window.bookSummaryJSON = "<p>Perfection. One word. Three syllables. Every reason why I'll never have the one thing I truly want. I stand dutifully on the pedestal he's built, waiting for the day he truly sees me. Then one amazing night, he lets down his walls, only to leave me the next day. </p> <p>Years have passed, and I've tried to move on with my life. But I still dream of him. I still miss him everyday. The memories haunt me. How can I look to the future when my past remains a mystery? The time has come to find the boy who stole my heart and ran away without a word. </p> <p>But not everyone who is lost wants to be found. My name is Alexandra Fontaine, and this is my story of unfinished love. </p> <p><i>Wings Over Poppies</i> is book two in the Over series and can be heard as a standalone novel. </p> <p>Warning: This is a new adult romance. It is not intended for listeners under the age of 18. </p>"; 
